INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 1.4, 2, 0, "お！\nあそこに困ってそうな人発見！", 1, 0, "春咲 ひより", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 1.4, 2, 0, "大切な人を\n守れるようになりたい…って", 1, 0, "草野 優衣", 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "少しは磨かれると思いますよ。", 1003, 1.4, 2, 0, "キミに必要な集中力と感性が", 1, 0, "士条 怜", 0, "フェンシングを始めてみては？", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 1.5, 2, 0, "今日はなにして遊ぶ？", 1, 0, "穂高 みそぎ", 0, "ねぇ、にいちゃん！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "私といっしょに…\nいかない？", 1006, 1.4, 2, 0, "ねぇ…", 1, 0, "風宮 あかり", 0, "風宮あかりです", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "食べ物の恨みは怖いのー", 1007, 1.5, 2, 0, "プリンたべたいのー", 1, 0, "出雲 宮子", 0, "出雲宮子なのー", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "いいよ。\n見られることは運命さ…", 1008, 1.4, 2, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, "虹村 雪", 0, "ボクは虹村雪。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "人呼んで「疾風の冥姫」!!", 1009, 1.4, 2, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, "柊杏奈", 0, "フッ…聞いて後悔するがいい！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ほんまおおきにやわ～♪", 1010, 1.5, 2, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, "姫宮 真歩", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ここで会ったが\n100年目～！", 1011, 1.4, 2, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, "衣之咲 璃乃", 0, "衣之咲璃乃です！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "…って、お願い！\n誰にも言わないでおいて～！", 1012, 1.4, 2, 0, "ち、超能力って…\n何のことかな～？", 1, 0, "柏崎 初音", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 1.4, 2, 0, "一応カリスマ読モJKやってまっす！", 1, 0, "美波 鈴奈", 0, "ちょす！\n美波鈴奈だよ～♪", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "でも、沖縄もとってもいいとこさー", 1017, 1.4, 2, 0, "東京は遊園地みたいなところさー", 1, 0, "喜屋武 香織", 0, "はいたーい。\n喜屋武香織さー。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "イオちゃんって呼んでね。", 1018, 1.4, 2, 0, "先生って呼ばれるのは\nくすぐったいから", 1, 0, "支倉 伊緒", 0, "支倉伊緒です。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ミミをおいてかないでぇ～", 1020, 1.5, 2, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, "茜 ミミ", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ふぇぇぇぇぇん……", 1021, 1.5, 2, 0, "あの……\nふぇ……", 1, 0, "栗林 くるみ", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "なんてありがとうございます！", 1022, 1.4, 2, 0, "こんな私に貴重な時間を\n割いていただき、", 1, 0, "風宮 より", 0, "風宮よりです。\nあああああ！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "私こっち行きたいー\nね、早く早くー", 1023, 1.5, 2, 0, "おにいちゃんどこいくの？\nえ？", 1, 0, "北条 綾音", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "これて何か違う…\nあああすみません！", 1025, 1.4, 2, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, "天野 すずめ", 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "離しませんわ………\n絶対に…!!", 1027, 1.4, 2, 0, "あなたは…運命の……\n伴侶……", 1, 0, "倉石 恵理子", 0, "……クスクス…私は\n…倉石恵理子……", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "…そうでしょ？？", 1028, 1.4, 2, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, "佐々木 咲恋", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "あはは、\n私もまだまだだなぁ～", 1029, 1.4, 2, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, "桜井 望", 0, "桜井望だよ！\nよろしくねっ", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 1.4, 2, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, "ニノン・ジュベール", 0, "デケデケデンっ！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "おかしいですね……", 1031, 1.4, 2, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, "上喜 しのぶ", 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "そう、\nオラのボケに突っ込める相方が…！", 1033, 1.5, 2, 0, "けんども\nそれには足りないモンが…", 1, 0, "野戸まひる", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ちょ\nちょっと一杯飲んできます…！", 1034, 1.4, 2, 0, "ちょっと緊張しちゃって…", 1, 0, "綾瀬 ゆかり", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "これ以上お話しすることは…\nないです！", 1036, 1.5, 2, 0, "知らない人とは話しちゃいけないので", 1, 0, "氷川 鏡華", 0, "氷川鏡華…です", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 1.4, 2, 0, "……あ、アラーム。", 1, 0, "柏崎 栞", 0, "柏崎…栞です。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "野に咲く花が、\n唯一の話相手です。", 1040, 1.4, 2, 0, "私、一人も友達がいなくて……", 1, 0, "双葉 碧", 0, "ふ、双葉碧です。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "そう思っています。", 1042, 1.4, 2, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, "三角 千歌", 0, "三角千歌です。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "う、疑ってすまなかったな…", 1043, 1.4, 2, 0, "あぁ？\nお前のそいつの仲間か？", 1, 0, "安芸 真琴", 0, "安芸真琴だ。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 1.4, 2, 0, "生けとし生ける全ての者よ！", 1, 0, "イリヤ・オーンスタイン", 0, "わらわこそは夜を総べる者！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "ｌク、クウカに何かご用ですか!?", 1045, 1.4, 2, 0, "ぐふふふふ……はっ！", 1, 0, "遠見 空花", 0, "そこで騎士は妖精を乱暴に……", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 1.4, 2, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, "宮坂たまき", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 1.4, 2, 0, "それでは早速クエストに…", 1, 0, "大神 美冬", 0, "大神美冬よ！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 1.4, 2, 0, "クエストもバトルも\n掃除も洗濯も", 1, 0, "星野静流", 0, "星野静流だよ！", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 1.5, 2, 0, "見ての通りの\nセクシー美少女で", 1, 0, "玉泉美咲", 0, "アタシは玉泉美咲。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "？？？？", 1052, 1.4, 2, 0, "？？？？", 1, 0, "リマ", 0, "？？？", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "そ、そこまでいうなら\nもらってやる", 1053, 1.5, 2, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, "モニカ・ヴァイスヴィント", 0, "モニカ・ヴァイスヴィントだ。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "そ、そこまでいうなら\nもらってやる", 1058, 1.5, 2, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, "ペコリーヌ", 0, "モニカ・ヴァイスヴィントだ。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "そ、そこまでいうなら\nもらってやる", 1059, 1.5, 2, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, "コッコロ", 0, "モニカ・ヴァイスヴィントだ。", 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (0, 1, "そ、そこまでいうなら\nもらってやる", 1060, 1.5, 2, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, "キャル", 0, "モニカ・ヴァイスヴィントだ。", 1, 0);
